fy these aassumption. \n","\n"]},{"cell_type":"markdown","id":"eb214335","metadata":{"papermill":{"duration":0.015864,"end_time":"2023-04-27T14:34:17.77946","exception":false,"start_time":"2023-04-27T14:34:17.763596","status":"completed"},"tags":[]},"source":["<a id=\"#subsection-5-3\"></a>\n","### <span style=\"color:#E8937D\"> Steps</span>\n","\n","The CDC has found that reaching 8k steps per day is associated with a 51% lower risk for all-cause mortality compared to someone who only reaches 4k steps a day. They also found that reaching 12k steps per day was associated with a 65% lower risk compared with reaching 4k.Theses results are not effected by step intensity.\n","I want to figure out how many users fall into the step categories of less than 4k, between 4k to 8k, 8k to 12k and more than 12k. First I created a pivot table in Google sheets to find the average daily steps of each user and then imported it as a csv. I then created a new dataframe with the precent of users in the 4 groups and put them in a chart.\n"]},{"cell_type":"code","execution_count":12,"id":"7804de02","metadata":{"execution":{"iopub.execute_input":"2023-04-27T14:34:17.819692Z","iopub.status.busy":"2023-04-27T14:34:17.817131Z","iopub.status.idle":"2023-04-27T14:34:18.356822Z","shell.execute_reply":"2023-04-27T14:34:18.353951Z"},"papermill":{"duration":0.562966,"end_time":"2023-04-27T14:34:18.359832","exception":false,"start_time":"2023-04-27T14:34:17.796866","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m33\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m2\u001b[39m\n","\u001b[36m\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[32mdbl\u001b[39m (2): Id, StepAverage\n","\n","\u001b[36m\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36m\u001b[39m Specify the column types or set `show_col_types = FA